import React from "react";
import dataBg from "../../img/bsu/data.jpg";

const Data = () => {
  return (
    <div className="data full-section">
      <div className="data-wrapper col-12 col-xl-8">
        <h2 className="mb-5">Data</h2>
        <p>
          The ammount of BSU is determined by the number of Master nodes. Each
          node must add certain storage capacity to Inery. The ammoun of BSU in
          the Inery Blockchain is a directly connected with the ammoun of data
          users add to the blockchain.
        </p>
      </div>

      <img
        className="data--background"
        src={dataBg}
        alt="data background image"
      />
    </div>
  );
};

export default Data;
